<div data-component-name="KernelViewer" style="display: flex; flex-direction: column; flex: 1 0 auto;"></div><script>var Kaggle=window.Kaggle||{};Kaggle.State=Kaggle.State||[];Kaggle.State.push({"kernel":{"id":335876,"title":"Exploring Survival on the Titanic - var3","forkParent":{"kernelId":335160,"runId":1423004,"url":"/vikramatjob/exploring-survival-on-the-titanic-var2","title":"Exploring Survival on the Titanic - var2","author":{"id":1160372,"displayName":"vikram","email":null,"editedEmail":null,"editedEmailCode":null,"userName":"vikramatjob","thumbnailUrl":"https://storage.googleapis.com/kaggle-avatars/thumbnails/default-thumb.png","profileUrl":"/vikramatjob","registerDate":"0001-01-01T00:00:00Z","lastVisitDate":"0001-01-01T00:00:00Z","statusId":0,"performanceTier":0,"userRoles":null,"userLogins":null,"groupIds":null,"duplicateUsers":null,"hasPhoneVerifications":false,"failedNerdchas":0,"hasPendingNerdcha":false,"deleteRequests":null,"userAttributes":null,"isAdmin":false,"isTvc":false,"isKaggleBot":false,"isAdminOrTvc":false,"isAnonymous":false,"canAct":false,"canBeSeen":false,"thumbnailName":null,"activationCode":"00000000-0000-0000-0000-000000000000","isPhoneVerified":false},"diff":{"linesInserted":26,"linesDeleted":2,"linesChanged":0,"linesUnchanged":0,"newTotalLines":0,"url":"/vikramatjob/exploring-survival-on-the-titanic-var3/versions#base=1423004\u0026new=1423072"},"isRedacted":false,"dateCreated":"2017-08-12T03:28:38.843Z","outputFilesTotalSizeBytes":142780,"workerStatus":"complete","isolatorResults":null,"languageId":1},"currentRunId":1423072,"mostRecentRunId":1423072,"url":"/vikramatjob/exploring-survival-on-the-titanic-var3","tags":[],"commentCount":0,"upvoteCount":0,"viewCount":19,"forkCount":0,"bestPublicScore":null,"author":{"id":1160372,"displayName":"vikram","email":null,"editedEmail":null,"editedEmailCode":null,"userName":"vikramatjob","thumbnailUrl":"https://storage.googleapis.com/kaggle-avatars/thumbnails/default-thumb.png","profileUrl":"/vikramatjob","registerDate":"0001-01-01T00:00:00Z","lastVisitDate":"0001-01-01T00:00:00Z","statusId":0,"performanceTier":1,"userRoles":null,"userLogins":null,"groupIds":null,"duplicateUsers":null,"hasPhoneVerifications":false,"failedNerdchas":0,"hasPendingNerdcha":false,"deleteRequests":null,"userAttributes":null,"isAdmin":false,"isTvc":false,"isKaggleBot":false,"isAdminOrTvc":false,"isAnonymous":false,"canAct":false,"canBeSeen":false,"thumbnailName":null,"activationCode":"00000000-0000-0000-0000-000000000000","isPhoneVerified":false},"isPrivate":false,"updatedTime":"2017-08-12T05:06:16.27Z","selfLink":"/kernels/335876","pinnedDockerImageVersionId":null,"isLanguageTemplate":false,"medal":null,"topicId":null,"readGroupId":null,"writeGroupId":null,"slug":"exploring-survival-on-the-titanic-var3"},"kernelBlob":{"id":4977109,"settings":{"dockerImageVersionId":null,"dataSources":[{"sourceType":"Competition","sourceId":3136,"databundleVersionId":null}],"sourceType":"script","language":"r","isGpuEnabled":false,"isInternetEnabled":false},"source":"\n# will try different imputations this time. \n\n# Load packages\nlibrary(\u0027ggplot2\u0027) # visualization\nlibrary(\u0027ggthemes\u0027) # visualization\nlibrary(\u0027scales\u0027) # visualization\nlibrary(\u0027dplyr\u0027) # data manipulation\nlibrary(\u0027mice\u0027) # imputation\nlibrary(\u0027randomForest\u0027) # classification algorithm\nlibrary(\u0027caret\u0027)\nlibrary(\u0027MASS\u0027)\nlibrary(\u0027rpart\u0027)\nlibrary(\u0027kernlab\u0027)\n\ntrain \u003c- read.csv(\u0027../input/train.csv\u0027, stringsAsFactors = F)\ntest  \u003c- read.csv(\u0027../input/test.csv\u0027, stringsAsFactors = F)\n\nfull  \u003c- bind_rows(train, test) # bind training \u0026 test data\n\n# check data\nstr(full)\n\nfull$Title \u003c- gsub(\u0027(.*, )|(\\\\..*)\u0027, \u0027\u0027, full$Name)\n\ntable(full$Sex, full$Title)\n\nrare_title \u003c- c(\u0027Dona\u0027, \u0027Lady\u0027, \u0027the Countess\u0027,\u0027Capt\u0027, \u0027Col\u0027, \u0027Don\u0027, \n                \u0027Dr\u0027, \u0027Major\u0027, \u0027Rev\u0027, \u0027Sir\u0027, \u0027Jonkheer\u0027)\n\nfull$Title[full$Title == \u0027Mlle\u0027]        \u003c- \u0027Miss\u0027 \nfull$Title[full$Title == \u0027Ms\u0027]          \u003c- \u0027Miss\u0027\nfull$Title[full$Title == \u0027Mme\u0027]         \u003c- \u0027Mrs\u0027 \nfull$Title[full$Title %in% rare_title]  \u003c- \u0027Rare Title\u0027\n\ntable(full$Sex, full$Title)\n\nfull$Surname \u003c- sapply(full$Name,  \n                      function(x) strsplit(x, split = \u0027[,.]\u0027)[[1]][1])\n\ncat(paste(\u0027We have \u003cb\u003e\u0027, nlevels(factor(full$Surname)), \u0027\u003c/b\u003e unique surnames. \u0027))\n\n# Create a family size variable including the passenger themselves\nfull$Fsize \u003c- full$SibSp + full$Parch + 1\n\n# Create a family variable \nfull$Family \u003c- paste(full$Surname, full$Fsize, sep=\u0027_\u0027)\n\n# Use ggplot2 to visualize the relationship between family size \u0026 survival\nggplot(full[1:891,], aes(x = Fsize, fill = factor(Survived))) +\n  geom_bar(stat=\u0027count\u0027, position=\u0027dodge\u0027) +\n  scale_x_continuous(breaks=c(1:11)) +\n  labs(x = \u0027Family Size\u0027) +\n  theme_few()\n\n# Discretize family size\nfull$FsizeD[full$Fsize == 1] \u003c- \u0027singleton\u0027\nfull$FsizeD[full$Fsize \u003c 5 \u0026 full$Fsize \u003e 1] \u003c- \u0027small\u0027\nfull$FsizeD[full$Fsize \u003e 4] \u003c- \u0027large\u0027\n\n# Show family size by survival using a mosaic plot\nmosaicplot(table(full$FsizeD, full$Survived), main=\u0027Family Size by Survival\u0027, shade=TRUE)\n\nfull$Cabin[1:28]\n\n# The first character is the deck. For example:\nstrsplit(full$Cabin[2], NULL)[[1]]\n\n# Create a Deck variable. Get passenger deck A - F:\nfull$Deck\u003c-factor(sapply(full$Cabin, function(x) strsplit(x, NULL)[[1]][1]))\n\n# Passengers 62 and 830 are missing Embarkment\nfull[c(62, 830), \u0027Embarked\u0027]\n\ncat(paste(\u0027We will infer their values for **embarkment** based on present data that we can imagine may be relevant: **passenger class** and **fare**. We see that they paid\u003cb\u003e $\u0027, full[c(62, 830), \u0027Fare\u0027][[1]][1], \u0027\u003c/b\u003eand\u003cb\u003e $\u0027, full[c(62, 830), \u0027Fare\u0027][[1]][2], \u0027\u003c/b\u003erespectively and their classes are\u003cb\u003e\u0027, full[c(62, 830), \u0027Pclass\u0027][[1]][1], \u0027\u003c/b\u003eand\u003cb\u003e\u0027, full[c(62, 830), \u0027Pclass\u0027][[1]][2], \u0027\u003c/b\u003e. So from where did they embark?\u0027))\n\n# Get rid of our missing passenger IDs\nembark_fare \u003c- full %\u003e%\n  filter(PassengerId != 62 \u0026 PassengerId != 830)\n\nggplot(embark_fare, aes(x = Embarked, y = Fare, fill = factor(Pclass))) +\n  geom_boxplot() +\n  geom_hline(aes(yintercept=80), \n    colour=\u0027red\u0027, linetype=\u0027dashed\u0027, lwd=2) +\n  scale_y_continuous(labels=dollar_format()) +\n  theme_few()\n\nfull$Embarked[c(62, 830)] \u003c- \u0027C\u0027\n\nfull[1044, ]\n\nggplot(full[full$Pclass == \u00273\u0027 \u0026 full$Embarked == \u0027S\u0027, ], \n  aes(x = Fare)) +\n  geom_density(fill = \u0027#99d6ff\u0027, alpha=0.4) + \n  geom_vline(aes(xintercept=median(Fare, na.rm=T)),\n    colour=\u0027red\u0027, linetype=\u0027dashed\u0027, lwd=1) +\n  scale_x_continuous(labels=dollar_format()) +\n  theme_few()\n\nfull$Fare[1044] \u003c- median(full[full$Pclass == \u00273\u0027 \u0026 full$Embarked == \u0027S\u0027, ]$Fare, na.rm = TRUE)\n\nfull$Fare[1044]\n\nsum(is.na(full$Age))\n\nfactor_vars \u003c- c(\u0027PassengerId\u0027,\u0027Pclass\u0027,\u0027Sex\u0027,\u0027Embarked\u0027,\n         \u0027Title\u0027,\u0027Surname\u0027,\u0027Family\u0027,\u0027FsizeD\u0027)\n\nfactor_vars                 \n\nfull[factor_vars] \u003c- lapply(full[factor_vars], function(x) as.factor(x))\n\nfull[factor_vars]\n\nbp \u003c- 1\n\nbp\n\n# Perform mice imputation, excluding certain less-than-useful variables:\n# mice_mod \u003c- mice(full[, !names(full) %in% c(\u0027PassengerId\u0027,\u0027Name\u0027,\u0027Ticket\u0027,\u0027Cabin\u0027,\u0027Family\u0027,\u0027Surname\u0027,\u0027Survived\u0027)], method=\u0027rf\u0027) \n\nbp \u003c- 2\nbp\n\n# mice_output \u003c- complete(mice_mod)\n\nbp \u003c- 3\nbp\n\nset.seed(129)\n\n\n# Perform mice imputation, excluding certain less-than-useful variables:\nmice_mod \u003c- mice(full[, !names(full) %in% c(\u0027PassengerId\u0027,\u0027Name\u0027,\u0027Ticket\u0027,\u0027Cabin\u0027,\u0027Family\u0027,\u0027Surname\u0027,\u0027Survived\u0027)], method=\u0027fastpmm\u0027) \nmice_output \u003c- complete(mice_mod)\n\n\nbp \u003c- 4\nbp\n\nbp \u003c- 5\nbp\n\n\npar(mfrow=c(1,2))\nhist(full$Age, freq=F, main=\u0027Age: Original Data\u0027, \n  col=\u0027darkgreen\u0027, ylim=c(0,0.04))\nhist(mice_output$Age, freq=F, main=\u0027Age: MICE Output\u0027, \n  col=\u0027lightgreen\u0027, ylim=c(0,0.04))\n\n\nfull$Age \u003c- mice_output$Age\n\nggplot(full[1:891,], aes(Age, fill = factor(Survived))) + \n  geom_histogram() + \n  facet_grid(.~Sex) + \n  theme_few()\n  \n  full$Child[full$Age \u003c 18] \u003c- \u0027Child\u0027\nfull$Child[full$Age \u003e= 18] \u003c- \u0027Adult\u0027\n\ntable(full$Child, full$Survived)\n\nfull$Mother \u003c- \u0027Not Mother\u0027\nfull$Mother[full$Sex == \u0027female\u0027 \u0026 full$Parch \u003e 0 \u0026 full$Age \u003e 18 \u0026 full$Title != \u0027Miss\u0027] \u003c- \u0027Mother\u0027\n\ntable(full$Mother, full$Survived)\n\nfull$Child  \u003c- factor(full$Child)\nfull$Mother \u003c- factor(full$Mother)\n\nmd.pattern(full)\n\ntrain \u003c- full[1:891,]\ntest \u003c- full[892:1309,]\n\n\ntrain2 \u003c- train\ntest2 \u003c- test\n\n# Run algorithms using 10-fold cross validation\ncontrol \u003c- trainControl(method=\u0022cv\u0022, number=10)\nmetric \u003c- \u0022Accuracy\u0022\n\nset.seed(7)\nfit.rf \u003c- train(factor(Survived) ~ Pclass + Sex + Age + SibSp + Parch + Fare + Embarked + Title + \n                                            FsizeD + Child + Mother, data=train2, method=\u0022rf\u0022, metric=metric, trControl=control)\n\nset.seed(7)\nfit.lda \u003c- train(factor(Survived) ~ Pclass + Sex + Age + SibSp + Parch + Fare + Embarked + Title + \n                                            FsizeD + Child + Mother, data=train2, method=\u0022lda\u0022, metric=metric, trControl=control)\n\nset.seed(7)\nfit.cart \u003c- train(factor(Survived) ~ Pclass + Sex + Age + SibSp + Parch + Fare + Embarked + Title + \n                                            FsizeD + Child + Mother, data=train2, method=\u0022rpart\u0022, metric=metric, trControl=control)\n# kNN\nset.seed(7)\nfit.knn \u003c- train(factor(Survived) ~ Pclass + Sex + Age + SibSp + Parch + Fare + Embarked + Title + \n                                            FsizeD + Child + Mother, data=train2, method=\u0022knn\u0022, metric=metric, trControl=control)\n# c) advanced algorithms\n# SVM\nset.seed(7)\nfit.svm \u003c- train(factor(Survived) ~ Pclass + Sex + Age + SibSp + Parch + Fare + Embarked + Title + \n                                            FsizeD + Child + Mother, data=train2, method=\u0022svmRadial\u0022, metric=metric, trControl=control)\n\n\nresults \u003c- resamples(list(lda=fit.lda,rf=fit.rf,cart=fit.cart,knn=fit.knn,svm=fit.svm))\nsummary(results)\n\ndotplot(results)\n\nset.seed(754)\n\n# Build the model (note: not all possible variables are used)\nrf_model \u003c- randomForest(factor(Survived) ~ Pclass + Sex + Age + SibSp + Parch + \n                                            Fare + Embarked + Title + \n                                            FsizeD + Child + Mother,\n                                            data = train)\n\nrf_model\n\n\nplot(rf_model, ylim=c(0,0.36))\nlegend(\u0027topright\u0027, colnames(rf_model$err.rate), col=1:3, fill=1:3)\n\nimportance    \u003c- importance(rf_model)\nvarImportance \u003c- data.frame(Variables = row.names(importance), \n                            Importance
